import CartItem from "./CartItem";

export default function CartItemList({items}) {

    let newList = [];
    for (let i = 0; i < items.length; i++) {
        let itemActual = {amount: 0, itemId: items[i].id};
        for (let k = 0; k < items.length; k++) {
            if (itemActual.itemId == items[k].id)
            {
                itemActual.amount++;
            }
        }
        newList.push(itemActual);
    }

    let defList = [...newList]
    for (let i = 0; i < defList.length; i++) {
        let actualItem = defList[i].itemId;
        for (let k = 0; k < newList.length; k++) {
            let tempItem = newList[k].itemId
            if (actualItem == tempItem) {
                defList.splice(i, 1);
                break;
            }
        }
    }

    console.log(defList)

    return (
        <div className="CartList">
            {
                defList.map((el) => {
                    return (
                        <p>{el.itemId}</p>
                    )
                })
            }
        </div>
    )
}
